import React, { Component } from "react";
import { GridList, Container, Grid } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h2>Cart</h2>
        <GridList
          cellHeight={100}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow"].map(color => (
            <Grid
              direction="row"
              justify="flex-start"
              alignItems="center"
              style={{ background: color }}
            >
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt="Cart"
              />
              <h3>Product name</h3>
              <Container>
                <h3>Product name</h3>
                <h3>Product name</h3>
              </Container>
            </Grid>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;
